import React from 'react';
import { GraduationCap, Home, Building2, User, ListTodo, Phone, LogOut } from 'lucide-react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

export function Navbar() {
    const navigate = useNavigate();
    const location = useLocation();
    const { signOut } = useAuth();

    const handleLogout = () => {
        const confirmed = window.confirm('Are you sure you want to logout?');
        if (confirmed) {
            signOut();
            navigate('/');
        }
    };

    return (
        <nav className="bg-black text-white px-6 py-4">
            <div className="max-w-7xl mx-auto flex items-center justify-between">
                <Link to="/" className="flex items-center space-x-2">
                    <GraduationCap size={24} className="text-white" />
                    <span className="text-xl font-bold">Uni Earn</span>
                </Link>

                <div className="flex items-center space-x-8">
                    <NavLink to="/home" icon={<Home size={18} />} text="Home" active={location.pathname === '/home'} />
                    <NavLink to="/company" icon={<Building2 size={18} />} text="Company" active={location.pathname === '/company'} />
                    <NavLink to="/profile" icon={<User size={18} />} text="Profile" active={location.pathname === '/profile'} />
                    <NavLink to="/activities" icon={<ListTodo size={18} />} text="Activities" active={location.pathname === '/activities'} />
                    <NavLink to="/contact" icon={<Phone size={18} />} text="Contact" active={location.pathname === '/contact'} />
                    <button
                        onClick={handleLogout}
                        className="flex items-center space-x-1 text-red-500 hover:text-red-400 transition-colors"
                    >
                        <LogOut size={18} />
                        <span>Logout</span>
                    </button>
                </div>
            </div>
        </nav>
    );
}

function NavLink({ to, icon, text, active = false }) {
    return (
        <Link
            to={to}
            className={`flex items-center space-x-1 ${
                active ? 'text-white' : 'text-gray-400'
            } hover:text-white transition-colors`}
        >
            {icon}
            <span>{text}</span>
        </Link>
    );
}


